import { useEffect, useState } from "react";
import BlogList from "./BlogList";

const Home = () => {

const { data: blogs, isPending,error } = useFetch("http://localhost:8000/blogs")

  return (
    <div className="home">
    { error && <div> {error} </div> }
      { isPending && <div>Loading...</div> }
      {blogs && <BlogList blogs={blogs} title = "My Blog" />}
    </div>
  );
}

export default Home;
